public boolean containsFile(final String fileNameRegexp) {
    boolean containsFile = false;
    for (File currentFile : files) {
        if (Pattern.matches(fileNameRegexp, currentFile.getName())) {
            containsFile = true;
            break;
        }
    }
    return containsFile;
}
